import {
  withScriptjs,
  withGoogleMap,
  GoogleMap,
  Marker,
} from "react-google-maps";
import React from "react";

export default function Maps(props) {

  const [alltambon, setTambon] = React.useState([]);
  React.useEffect(() => {
    async function getJSON() {
      const response = await fetch("http://localhost:3333/getallcase", {
        method: "GET", // or 'PUT'
      });

      const sum = await response.json();

      setTambon(sum);
    }
    getJSON() 
  }, []);
  let data = Object.values(alltambon);
  console.log(data);
  const MapWithAMarker = withScriptjs(
    withGoogleMap((alltambon) => (
      <GoogleMap
        defaultZoom={10}
        defaultCenter={{ lat: -34.397, lng: 150.644 }}
      >
        <Marker position={{ lat: -34.397, lng: 150.644 }} />
        {props.alltambon?.map((row) => (
              <Marker position={{ lat:row.LAT, lng:row.LONG}} />
            ))}
      </GoogleMap>
    ))
  );
  return (
    <MapWithAMarker
      googleMapURL="https://maps.googleapis.com/maps/api/js?key=AIzaSyBJNF1WF1PZ072rIlzasimj-wEVnaCu2WY&v=3.exp&libraries=geometry,drawing,places"
      loadingElement={<div style={{ height: `100%` }} />}
      containerElement={<div style={{ height: `800px` }} />}
      mapElement={<div style={{ height: `100%` }} />}
    />
  );
}
